import React, { Component } from "react";
import Mask from "./component/Mask";
import './App.css'
import Nav from "./component/Nav";

class App extends Component {
  render() {
    return (
      <>
        <div>
          <Nav />
          <Mask />
        </div>
      </>
    );
  }
}

export default App;
